import React, { Component } from 'react'

export class Bezitting extends Component {


    getStyle = () => {
        if (this.props.items.bezitting){
            return{
                background: 'blue',
                textDecoration: 'none'
            }
        }else{
            return{
                background: 'red',
                textDecoration: 'line-through'
            }
        }
    }
   
    render() {
        return (
            this.props.items.map
        )
    }
}


export default Bezitting
